import React from 'react';
import { Route, Navigate } from 'react-router-dom';

const PrivateRoute = ({ isLogin, ...props }) => {
  return isLogin ? <Route {...props} /> : <Navigate to="/LoginLayout" />;
};

export default PrivateRoute;
